def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                key = group_axis.get_level_values(level)
                level = None

        else:
            if is_list_like(level):
                nlevels = len(level)
                if nlevels == 1:
                    level = level[0]
                elif nlevels == 0:
                    raise ValueError("No group keys passed!")
                else:
                    raise ValueError("multiple levels only valid with MultiIndex")

            if level == group_axis.name:
                key = group_axis

    if key in obj:
        in_axis, name = True, key
        exclusions = [name]
    else:
        in_axis, name = False, None
        exclusions = []

    if isinstance(name, str) and obj.index.name != name:
        raise ValueError("level name {} is not the name of the index".format(name))

    if is_categorical_dtype(name) and len(name) != obj.shape[axis]:
        raise ValueError(
            (
                "Length of grouper ({len_gpr}) and axis ({len_axis})"
                " must be same length".format(
                    len_gpr=len(name), len_axis=obj.shape[axis]
                )
            )
        )

    pings = [
        Grouping(
            group_axis,
            name,
            obj=obj,
            name=name,
            level=None,
            sort=sort,
            observed=observed,
            in_axis=in_axis,
        )
    ]

    grouper = BaseGrouper(group_axis, pings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
